webpackJsonp([75,429],{1588:function(e,l,t){e.exports={frontmatter:t(589),content:t(2778)}},2778:function(e,l,t){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>Hvor i All Verden? er et reise- og geografispill hvor man raskest mulig skal fly innom reisemål spredt rundt i Europa. Dette er den siste av tre leksjoner. I denne delen skal vi se på lister og hvordan vi kan bruke dem til å velge reisemål tilfeldig. Vi vil avslutte med å lage en skikkelig intro til spillet.</p> <figure><img src="+t(3530)+' alt=""></figure> </section> <section class=activity id=steg-0-forrige-gang> <h1 class=activity id=steg-0-forrige-gang>Steg 0: Forrige gang</h1> <p><em>Vi fortsetter nå med det programmet vi laget i del 1 og del 2.</em></p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <p>Sjekk spesielt at</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> du har et helikopter som du kan styre over en rullende bakgrunn med piltastene,</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> du har en stedfigur som kan bli funnet av helikopteret,</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> du har laget en ny kloss (funksjon) som heter <code class=blockmoreblocks>Reis til</code>.</label></p> </li> </ul> </section> </section> <section class=activity id=steg-1-lag-lister> <h1 class=activity id=steg-1-lag-lister>Steg 1: Lag lister</h1> <p><em>Vi skal nå flytte reisemålene våre over i lister. Dette vil gjøre det enklere både å legge til flere reisemål, og å velge reisemål tilfeldig.</em></p> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Velg sted-figuren, og klikk på <code class=blockdata>Data</code>-kategorien. Lag en liste som du kaller <code>steder</code> og lar gjelde bare for denne figuren.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Det dukker nå opp en grå boks på scenen som heter <code>Sted: steder</code>. Vi kan la denne ligge på scenen inntil videre. Du vil også se at det har kommet noen nye klosser som gjør ting med lister. Skjønner du hva noen av disse klossene gjør?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> La oss fylle opp listen! Vi starter med en ny melding, og deretter kan vi legge til ting i listen.</label></p> <pre class=blocks>når jeg mottar [Lag lister v]\nlegg [London] til [steder v]\nlegg [Oslo] til [steder v]\nlegg [Barcelona] til [steder v]\n</pre> <p>Bruk gjerne de samme reisemålene som du allerede har.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> Klikk på blokken du laget over slik at den kjører. Blir den grå boksen på scenen fyllt med steder? Hva skjer om du klikker flere ganger?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Vi kan sikre oss at hvert sted bare ligger en gang i listen ved å tømme listen før vi fyller den opp. Legg til</label></p> <pre class=blocks>slett (alle v) i [steder v]\n</pre> <p>i koden før du legger til det første reisemålet.</p> </li> </ul> <p>En liten utfordring med lister er at de bare inneholder en type verdier. For eksempel stedsnavn i dette tilfellet. Men for reisemålene må vi holde styr på tre ting: Stedsnavnet og de to koordinatene som sier hvor stedet ligger. En måte å gjøre dette på er å bruke tre lister.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Lag to nye lister, <code>stederX</code> og <code>stederY</code> som også gjelder kun for stedfiguren.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Vi vil nå utvide <code>Lag lister</code>-blokken slik at vi fyller opp alle tre listene. Bruk dine egne reisemål og koordinater her om du vil:</label></p> <pre class=blocks>når jeg mottar [Lag lister v]\nslett (alle v) i [steder v]\nslett (alle v) i [stederX v]\nslett (alle v) i [stederY v]\nlegg [London] til [steder v]\nlegg [-135] til [stederX v]\nlegg [-30] til [stederY v]\nlegg [Oslo] til [steder v]\nlegg [-30] til [stederX v]\nlegg [75] til [stederY v]\nlegg [Barcelona] til [steder v]\nlegg [-135] til [stederX v]\nlegg [-175] til [stederY v]\n</pre> <p>Pass på at de tre listene er samkjørte slik at det er verdier for samme reisemål som står for eksempel øverst i hver liste.</p> </li> </ul> </section> </section> <section class=activity id=steg-2-velg-et-reisemal-tilfeldig> <h1 class=activity id=steg-2-velg-et-reisemal-tilfeldig>Steg 2: Velg et reisemål tilfeldig</h1> <p><em>La oss begynne å bruke listene våre til å velge steder å reise til tilfeldig.</em></p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Først vil vi lage listene våre når spillet begynner. Endre på koden for <code class=blockevents>Nytt spill</code> slik,</label></p> <pre class=blocks>når jeg mottar [Nytt spill v]\nsend melding [Lag lister v]\nvis\nsend melding [Nytt sted v] og vent\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> Lag en ny variabel som heter <code class=blockdata>sted</code> og som gjelder kun for sted-figuren. Denne variabelen vil være et tall som identifiserer hvilken posisjon i listene det gjeldende reisemålet har.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> Koden for <code class=blockevents>Nytt sted</code> blir helt ny. Nå skal vi bruke både listene våre og den nye <code class=blockmoreblocks>Reis til</code>-klossen vi lagde forrige gang.</label></p> <pre class=blocks>når jeg mottar [Nytt sted v]\nsett [sted v] til (tilfeldig tall fra (1) til (lengden av [steder v]))\nReis til (element (sted) av [steder v]) (element (sted) av [stederX v]) (element (sted) av [stederY v]) :: custom\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> Prøv å kjør spillet flere ganger. Virker det som om reisemålet blir valgt tilfeldig?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> For å få flere reiseoppgaver i hvert spill kan vi bare legge en <code class=blockcontrol>gjenta _ ganger</code>-løkke rundt sendingen av meldingen <code>Nytt sted</code> i <code class=blockevents>Nytt spill</code>-blokken. Hvor mange ganger vil du gjenta meldingen?</label></p> </li> </ul> </section> </section> <section class=activity id=steg-3-fjern-reisemal-fra-listen> <h1 class=activity id=steg-3-fjern-reisemal-fra-listen>Steg 3: Fjern reisemål fra listen</h1> <p><em>I spillet vårt hender det at samme reisemål blir tilfeldig valgt flere ganger etter hverandre. Dette kan vi enkelt unngå ved å fjerne reisemål fra listene etterhvert som vi finner dem.</em></p> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste </h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> For å unngå å bli spurt om å reise til samme sted flere ganger på rad vil vi slette reisemål fra listene etterhvert som vi finner dem. Legg til slettekommandoer helt nederst i <code class=blockevents>Nytt sted</code>-blokken,</label></p> <pre class=blocks>slett (sted) i [steder v]\nslett (sted) i [stederX v]\nslett (sted) i [stederY v]\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Hva skjer om du prøver å gi flere oppgaver enn det er reisemål? Prøv selv!</label></p> <p>Den enkleste måten å unngå dette problemet på er å gi færre oppgaver eller legge inn flere reisemål i listene!</p> <p>Alternativt kan du øverst i <code>Nytt sted</code>-blokken legge inn en <code class=blockcontrol>hvis</code>-test som sjekker om lengden av <code>steder</code> er 0. Hvis den er det kan du sende en ny <code>Lag lister</code>-melding for å bygge listen på nytt.</p> </li> </ul> </section> </section> <section class=activity id=steg-4-en-introduksjon> <h1 class=activity id=steg-4-en-introduksjon>Steg 4: En introduksjon</h1> <p><em>Vi er nå nesten ferdige med spillet vårt. Men vi vil forbedre det som kalles programflyten slik at vi får en startmeny, og slik at vi kan spille flere ganger.</em></p> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> Lag en ny bakgrunn som kan brukes på startskjermen. Vi har tegnet en ny bakgrunn selv ved å bruke vektorgrafikk, sette sammen to store firkanter og fylle dem med fargeoverganger. Deretter skrev vi litt tekst på denne bakgrunnen.</label></p> <figure><img src='+t(3532)+' alt=""></figure> <p>Kall denne bakgrunnen for <code>meny</code>.</p> </li> </ul> <p>Vi skal nå sende flere meldinger som definerer programflyten. Vi vil at menyen vises når vi klikker på det grønne flagget. Fra menyen vil vi at et nytt spill starter når vi trykker mellomrom-tasten. Når spillet er slutt vil vi at menyen skal vises igjen. Vi kan tegne programflyten omtrent som dette:</p> <figure><img src='+t(3534)+' alt=""></figure> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> For å lage denne programflyten kan vi stort sett bruke skript på scenen. Lag de følgende enkle skriptene:</label></p> <pre class=blocks>når grønt flagg klikkes\nsend melding [Vis meny v]\n\nnår jeg mottar [Vis meny v]\nbytt bakgrunn til [meny v]\n\nnår [mellomrom v] trykkes\nhvis &lt;(bakgrunnsnavn) = [meny]&gt;\n    send melding [Nytt spill v]\nslutt\n\nnår jeg mottar [Nytt spill v]\nbytt bakgrunn til [spill v]\n\nnår jeg mottar [Spill slutt v]\nsend melding [Vis meny v]\n</pre> <p>Sammenlign disse skriptene med programflyten over. Ser du hvordan de henger sammen?</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Vi må sende melding når spillet er slutt. Hvordan vet vi at spillet er slutt?</label></p> <p>Spillet slutter etter at vi har besøkt reisemålene. Det betyr at vi må sende en melding <code>Spill slutt</code> etter <code class=blockcontrol>gjenta</code>-blokken på sted-figuren.</p> <p>Legg til denne meldingen og prøv spillet ditt. Virker programflyten? Starter spillet når du trykker mellomrom? Kommer du tilbake til menyen når spillet er slutt?</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Et problem er at helikopteret, stedet og kartet blir liggende over menyen når spillet er slutt. Vi må passe på at disse skjules. Legg følgende kode på alle de tre figurene:</label></p> <pre class=blocks>når jeg mottar [Spill slutt v]\nskjul\nstopp [andre skript i figuren v] :: control\n</pre> <p>Med <code class=blockcontrol>stopp</code>-klossen passer vi på at alle skriptene stopper når spillet er slutt.</p> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> Fungerer programflyten som den skal? Starter spillet når du trykker på mellomrom-tasten? Kommer du tilbake til menyen når spillet er slutt?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_22><label for=cbx_22> Skjules og vises alle figurene når de skal?</label></p> </li> </ul> </section> </section> <section class=activity id=steg-5-ta-tiden> <h1 class=activity id=steg-5-ta-tiden>Steg 5: Ta tiden</h1> <p><em>For å gjøre spillet litt mer spennende avslutter vi med å gi spilleren begrenset tid til å finne reisemålene.</em></p> <section class=check id=sjekkliste-6> <h2 class=check id=sjekkliste-6>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_23><label for=cbx_23> Lag en ny variabel, <code class=blockdata>Tid</code>, som gjelder for alle figurer. Det ser ganske bra ut om du høyreklikker på <code class=blockgrey>Tid</code>-boksen på scenen og velger <code>stor</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_24><label for=cbx_24> På scenen, sett <code class=blockdata>Tid</code> til for eksempel 30 (sekunder) etter <code class=blockevents>Nytt spill</code> mottas. Lag så en løkke som gjentas til <code class=blockdata>Tid</code> er 0. Inne i løkken kan du endre <code class=blockdata>Tid</code> med -1, og deretter vente 1 sekund. Avslutt med å sende ut meldingen <code>Spill slutt</code> etter løkken.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_25><label for=cbx_25> Kanskje du kan gi spilleren litt ekstra tid hver gang han finner et sted?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_26><label for=cbx_26> Til slutt må du legge på en <code class=blockcontrol>stopp</code>-kloss også på scenen når spillet er slutt for at tiden skal stoppe når spilleren har funnet alle reisemålene.</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_27><label for=cbx_27> Fungerer tidtakingen? Telles tiden nedover mot 0?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_28><label for=cbx_28> Avsluttes spillet når du har funnet alle reisemålene? Avsluttes spillet når tiden går ut?</label></p> </li> </ul> </section> <section class=save id=legg-ut-prosjektet> <h2 class=save id=legg-ut-prosjektet>Legg ut prosjektet</h2> <p>Nå er vi ferdige med spillet! Veldig bra! Vi håper du har lært mye spennende gjennom disse leksjonene. Du kan dele spillet med familie og venner ved å trykke <code>Legg ut</code> øverst til høyre på skjermen.</p> </section> <section class=try id=prov-selv> <h2 class=try id=prov-selv>Prøv selv</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_29><label for=cbx_29> Selv om leksjonene er ferdige betyr ikke det at du ikke kan videreutvikle spillet ditt. En enkel utvidelse er å legge på flere reisemål. Her er for eksempel to steder du kan legge til,</label></p> <pre class=blocks>legg [Reykjavik] til [steder v]\nlegg [-215] til [stederX v]\nlegg [210] til [stederY v]\nlegg [Roma] til [steder v]\nlegg [-30] til [stederX v]\nlegg [-180] til [stederY v]\n</pre> <p>men det er enda bedre om du finner på dine egne reisemål. Husk det trenger ikke bare være byer, det kan også være fjell, sjøer eller kanskje land!</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_30><label for=cbx_30> En måte å gjøre spillet ganske forskjellig på, og samtidig ganske likt, er å bytte ut kartet over Europa med et kart over et annet område. Det finnes mange kart på nettet. Prøv deg fram!</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_31><label for=cbx_31> Om spillet kjennes litt vanskelig kan man gi spilleren et hint ved å la den sirkelen sakte komme til syne mens han leter etter reisemålet. Om du lager en løkke som starter når <code class=blockevents>Nytt spill</code> mottas, og som sakte endrer den gjennomsiktige effekten ned mot 0 vil spilleren enklere kunne finne de vanskelige reisemålene.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_32><label for=cbx_32> Du kan også lage flere nivåer, for eksempel lett og vanskelig, ved å lage forskjellige lister avhengig av hvilket nivå spilleren velger (for eksempel ved å trykke <code>1</code> eller <code>2</code> i stedet for mellomrom når spillet starter).</label></p> </li> </ul> <p>Helt til slutt, husk at dette er ditt spill som du har laget! Du bestemmer selv hvordan du vil at spillet skal fungere!</p> </section> </section> '},3530:function(e,l,t){e.exports=t.p+"_/oppgaver/src/scratch/hvor_i_all_verden/hvor_i_all_verden_3.b27537.png"},3532:function(e,l,t){e.exports=t.p+"_/oppgaver/src/scratch/hvor_i_all_verden/meny.be4b3b.png"},3534:function(e,l){e.exports="data:image/png;base64,"}});